import React from "react";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import { NavLink } from "react-router-dom";



const Navbar = () => {

    return (
        <>
       <div className="menu_style">
                <NavLink exact to='/' activeClassName="active_class">
                    About
                </NavLink>
                <NavLink exact to='/contact' activeClassName="active_class">
                    Contact
                </NavLink>
                <NavLink exact to='/search' activeClassName="active_class">
                    Search
                </NavLink>
                <NavLink exact to='/user/aksn/kiwi' activeClassName="active_class">
                    User
                </NavLink>
                <NavLink exact to='/service' activeClassName="active_class">
                    Services
                </NavLink>


         </div>

 
        </>
    );
};
export default Navbar;
